function requestCsv(url, callback, callbackError, callbackAlways) {
	var csvHeaders = [];
	$.ajax({
		method: "GET",
		url: url
	}).done(function (r) {
		Papa.parse(r, {
			header: true,
			dynamicTyping: true,
			skipEmptyLines: true,
//			fastMode: true,
			beforeFirstChunk: function (chunk) {
				var rows = chunk.split(/\r\n|\r|\n/);
				var headings = rows[0].split(',');
				for (var i = 0; i < headings.length; i++) {
					var cm = _.camelCase(headings[i]);
					headings[i] = headings[i].replace(/"/g, "");
					headings[i] = headings[i].replace(':', "");
					csvHeaders[i] = {
						title: headings[i],
						data: cm
					};
					headings[i] = cm;
				}
				rows[0] = headings.join();
				return rows.join('\n');
			},
			complete: function (results) {
				callback({
					header: csvHeaders,
					results: results
				})
			},
			
		});
	}).error(function (results) {
		if(callbackError)
			callbackError(results)
			}).always(function () {
		if (callbackAlways)
			callbackAlways();
	});
}

function camelize(str) {
	return str.replace(/(?:^\w|[A-Z]|\b\w|\s+)/g, function (match, index) {
		if (+match === 0) return ""; // or if (/\s+/.test(match)) for white spaces
		return index == 0 ? match.toLowerCase() : match.toUpperCase();
	});
}

